import "./ContentList.css";
import Create from "./Create";
import dummy from "../resource/dummyData";

function ContentList() {
  return (
    <div className="ContentList">
      <header>
        <div></div>
        <h2>목록</h2>
        <button className="contentList__btn">글쓰기</button>
      </header>
      <ul className="contentList">
        <li className="content" id={dummy.id}>
          <div className="content__name">{dummy.username}</div>
          <div className="content__title">{dummy.title}</div>
          <div className="content__createdAt">날짜!</div>
        </li>
      </ul>
    </div>
  );
}

export default ContentList;
